import "./featuredProperties.css";

const FeaturedProperties = () => {
  return (
    <div className="fp">
      <img
        src="https://images.pexels.com/photos/4915547/pexels-photo-4915547.jpeg?auto=compress&cs=tinysrgb&w=1600"
        alt=""
        className="fpImg"
      />
    </div>
  );
};

export default FeaturedProperties;
